import React from "react";
import "./NavBar.css";
import { Link } from "react-router-dom";
import { Nav, Button, NavDropdown } from "react-boostrap";
import Navbar from "react-bootstrap/Navbar";
import Row from "react-boostrap/Row";
import Col from "react-bootstrap/Col";
import resume from "../../assets/sophia-resume.pdf";

type NavBarProps = {

};

type NavBarState = {

};

export default class NavBar extends React.Component<NavBarProps, NavBarState> {
  constructor(props: NavBarProps) {
    super(props);
    this.state = {};
  }

  render () {
    return (
      <div className="NavBar">
        <NavBar
          collapseOnSelect
          expand="lg"
          className="NavBar"
          style={{
            backgroundColor: "#F9F6F2",
            alignItems: "center",
            paddingLeft: "11vw",
            paddingRight: "11vw"
          }}
        >
          <NavBar.Toggle aria-controls="response-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="mr-auto"></Nav>
            <Nav className="tool-bar-container">
              <Col>
                <div className="navbar-about">
                  <Link to="/about">about</Link>
                </div>
              </Col>
              <Col>
                <div className="navbar-work">
                  <Link to="/work">work</Link>
                </div>
              </Col>
              <Col>
                <div className="navbar-about">
                  <a href={resume} target="_blank"></a>
                </div>
              </Col>
            </Nav>
          </Navbar.Collapse>
        </NavBar>
      </div>
    )
  }
}
